import React from 'react';
import NavBar from '../NavBar/NavBar';
import Footer from '../Footer/Footer';
import './About.scss';

export default function About() {
    return (
        <div className="about">
            <NavBar />
                <div className="about__details">
                    <span className="about__details--about">About</span>
                </div>
            <Footer />
        </div>
    )
}
